syntax = "proto3";

package tvntd;

option java_multiple_files = true;
option java_package = "com.tvntd.trust";
option java_outer_classname = "Chain";

message ObjectId {
    uint32                 w1 = 1;
    uint32                 w2 = 2;
    uint32                 w3 = 3;
    uint32                 w4 = 4;
    uint32                 w5 = 5;
    uint32                 w6 = 6;
    uint32                 w7 = 7;
    uint32                 w8 = 8;
}

